    # Функция дешифровки
    function Decrypt-Data {
        param([string]$encryptedData, [string]$keyBase64, [string]$ivBase64)
        
        try {
            $key = [System.Convert]::FromBase64String($keyBase64)
            $iv = [System.Convert]::FromBase64String($ivBase64)
            
            # Очищаем hex строку от лишних символов
            $cleanHex = $encryptedData -replace '[^0-9A-Fa-f]', ''
            
            # Проверяем что длина четная
            if ($cleanHex.Length % 2 -ne 0) {
                throw "Invalid hex string length"
            }
            
            # Конвертируем hex в bytes
            $encrypted = [System.Byte[]]::new($cleanHex.Length / 2)
            for ($i = 0; $i -lt $cleanHex.Length; $i += 2) {
                $byteStr = $cleanHex.Substring($i, 2)
                try {
                    $encrypted[$i / 2] = [System.Convert]::ToByte($byteStr, 16)
                } catch {
                    throw "Invalid hex character at position $i - '$byteStr'"
                }
            }

            
            $aes = [System.Security.Cryptography.Aes]::Create()
            $aes.Key = $key
            $aes.IV = $iv
            $aes.Mode = [System.Security.Cryptography.CipherMode]::CBC
            $aes.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
            
            $decryptor = $aes.CreateDecryptor()
            $decryptedBytes = $decryptor.TransformFinalBlock($encrypted, 0, $encrypted.Length)

            $decryptedText = [System.Text.Encoding]::UTF8.GetString($decryptedBytes)

            
            $aes.Dispose()
            return $decryptedText
        } catch {
            Write-Host "Decryption error: $($_.Exception.Message)" -ForegroundColor Red
            throw

        }
    }
    
